import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

function TestAnimation(){
    return (
        <motion.div
            initial={{
                opacity: 0
            }}
            animate={{
                opacity: 1,
                scale: 2.0
            }}
            transition={{
                duration: 3
            }}
        >
            Test Animation

        </motion.div>
    )

}

export default TestAnimation;
